import React from 'react';
import {Box,Container,Grid} from '@material-ui/core';
import HostelCard from './HostelCard'
import hs1 from 'assets/image/hostel.jpg'
export default function DisableElevation() {
  const data = [
    {
      name: 'Valeriia',
      price: 786,
      desc: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
      img:hs1
    },
    {
      name: 'Valeriia2',
      price: 7862,
      desc: '2Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
      img:hs1
    },
  ]
  const listItems = data.map((hostel) =>
    <Grid item xs={12} sm={6} md={4} lg={3}>
  <HostelCard name={hostel.name} price={hostel.price} desc={hostel.desc} img={hostel.img} />
    </Grid>

);


  return (
    <Container fixed>
      <Box fontSize={24} fontWeight={700} paddingTop={8} paddingBottom={ 4}>
        List
      </Box>
      <Grid container justify='center' alignItems='center'>
      {listItems}
      </Grid>




      </Container>
  );
}
